function setErrorNotNullGroupsLogin(clientLogin, clientPassword, setErrorNotNullLogin,
  setErrorNotNullPassword) {
  if (!clientLogin) {
    setErrorNotNullLogin();
  }
  if (!clientPassword) {
    setErrorNotNullPassword();
  }
}

export default setErrorNotNullGroupsLogin;
